sys_variable_value.value:
(function execute(inputs, outputs) {

  const oAuthData = JSON.parse(inputs.oauth_data);
  outputs.client_id = oAuthData.client_id;
  outputs.client_secret = oAuthData.client_secret;
  outputs.tokens = oAuthData.tokens;

})(inputs, outputs);

